angoca@osm-test:~/notes$ # Creates a function that performs a basic triage according to its longitude:
angoca@osm-test:~/notes$ # * -180 - -30: Americas.
angoca@osm-test:~/notes$ # * -30 - 25: West Europe and West Africa.
angoca@osm-test:~/notes$ # * 25 - 65: Middle East, East Africa and Russia.
angoca@osm-test:~/notes$ # * 65 - 180: Southeast Asia and Oceania.
angoca@osm-test:~/notes$ psql -d ${DBNAME} << EOF >> ${LOG_FILE} 2>&1
> CREATE OR REPLACE FUNCTION get_country (
>   lon DECIMAL,
>   lat DECIMAL,
>   id_note INTEGER
> ) RETURNS INTEGER
> LANGUAGE plpgsql
> AS \$func\$
>  DECLARE
>   id_country INTEGER;
>   f RECORD;
>   contains BOOLEAN;
>   iter INTEGER;
>   area VARCHAR(20);
>   start_proc TIMESTAMP;
>   end_proc TIMESTAMP;
>  BEGIN
>   start_proc := current_timestamp;
>   id_country := -1;
>   iter := 1;
>   IF (lat = 0 AND lon = 0) THEN
>    area := 'Null Island';
>   ELSIF (lon < -30) THEN -- Americas
>    area := 'Americas';
>    FOR f IN
>      SELECT geom, country_id
>      FROM countries
>      ORDER BY americas NULLS LAST
>     LOOP
>      contains := ST_Contains(f.geom, ST_SetSRID(ST_Point(lon, lat), 4326));
>      IF (contains) THEN
>       id_country := f.country_id;
>       EXIT;
>      END IF;
>      iter := iter + 1;
>     END LOOP;
>   ELSIF (lon < 25) THEN -- Europe & part of Africa
>    area := 'Europe/Africa';
>    FOR f IN
>      SELECT geom, country_id
>      FROM countries
>      ORDER BY europe NULLS LAST
>     LOOP
>      contains := ST_Contains(f.geom, ST_SetSRID(ST_Point(lon, lat), 4326));
>      IF (contains) THEN
>       id_country := f.country_id;
>       EXIT;
>      END IF;
>      iter := iter + 1;
>     END LOOP;
>   ELSIF (lon < 65) THEN -- Russia, Middle East & part of Africa
>    area := 'Russia/Middle east';
>    FOR f IN
>      SELECT geom, country_id
>      FROM countries
>      ORDER BY russia_middle_east NULLS LAST
>     LOOP
>      contains := ST_Contains(f.geom, ST_SetSRID(ST_Point(lon, lat), 4326));
>      IF (contains) THEN
>       id_country := f.country_id;
>       EXIT;
>      END IF;
>      iter := iter + 1;
>     END LOOP;
>   ELSE
>    area := 'Asia/Oceania';
>    FOR f IN
>      SELECT geom, country_id
>      FROM countries
>      ORDER BY asia_oceania NULLS LAST
>     LOOP
>      contains := ST_Contains(f.geom, ST_SetSRID(ST_Point(lon, lat), 4326));
>      IF (contains) THEN
>       id_country := f.country_id;
>       EXIT;
>      END IF;
>      iter := iter + 1;
>     END LOOP;
>   END IF;
>   end_proc := current_timestamp;
>   INSERT INTO tries VALUES (area, iter, id_note, id_country, EXTRACT(EPOCH FROM (end_proc - start_proc)) * 1000);
>   RETURN id_country;
>  END
> \$func\$
> EOF
